import { useCallback, useEffect, useState } from "react";
import "./index.css";
const App = () => {
  const [dataLocation, setDataLocation] = useState([]);
  const location = useCallback(async () => {
    const response = await fetch("https://randomuser.me/api/?results=20");
    const data = await response.json();
    console.log(data);

    const loadedLocation = [];
    for (const key in data.results) {
      loadedLocation.push({
        streetName: data.results[key].location.street.name,
        streetNumber: data.results[key].location.street.number,
      });
    }
    setDataLocation(loadedLocation);
  }, []);
  useEffect(() => {
    location();
  }, [location]);

  const dataList = dataLocation.map((adress) => (
    <tr>
      <td>
        {adress.streetName}
        {adress.streetNumber}
      </td>
    </tr>
  ));
  // const location = {
  //   streetName: "some name",
  //   streetNumber: "some number",
  //   city: "",
  //   postcode: "",
  // };
  // for (const [keys, value] of Object.entries(location)) {
  //   console.log(keys, value);
  // }

  // const locationData =

  // console.log(Object.entries(location)[0][0]);
  return (
    <div>
      <table className="table">
        <tr>
          <td>{Object.entries(location)[0][0]}</td>
          <td>{Object.entries(location)[1][0]}</td>
          <td>{Object.entries(location)[2][0]}</td>
          <td>{Object.entries(location)[3][0]}</td>
        </tr>
        {dataList}
      </table>
    </div>
  );
};

export default App;
